import { Route, Navigate } from "react-router-dom";

const PrivateRoute = ({ element: Element, ...rest }) => {
  const token = localStorage.getItem("token");

  return (
    <Route
      {...rest}
      element={
        token ? (
          <Element />
        ) : (
          <Navigate to="/" /> // Use Navigate for redirection in React Router v6
        )
      }
    />
  );
};
